import './App.css';
import React from "react";
import EditableTable from './components/EditableTable/EditableTable';
import EditMenu from './components/EditMenu/EditMenu';

import ReactNotification, { store } from 'react-notifications-component';
import 'react-notifications-component/dist/theme.css';

function App() {
  const handleNotification = (test) => {
    store.addNotification({ 
      message: "teodosii@react-notifications-component",
      type: "success",
      insert: "top",
      container: "top-center",
      animationIn: ["animate__animated", "animate__fadeIn"],
      animationOut: ["animate__animated", "animate__fadeOut"],
      dismiss: {
        duration: 2000, 
      }
    })
  }

  return (
    <div className="App">
      <ReactNotification />
      <button onClick={() => handleNotification("asdf")}>Test</button>
      <button onClick={() => handleNotification("aaaaaaaaa")}>Test</button>

      <EditMenu></EditMenu>
      <h1>Apotek Jakarta</h1>
      <br></br>
      <EditableTable
        tableName={'log_perubahan'}
      ></EditableTable>
      <EditableTable
        Editable
        tableName={'obat_kadaluarsa'}
      ></EditableTable>
      <EditableTable
        Editable
        tableName={'tabel_obat'}
      ></EditableTable>
      <EditableTable
        Editable
        tableName={'tabel_persediaan'}
      ></EditableTable>
    </div>
  );
}

export default App;
